import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';

import Header from './components/Header';
import Weekly from './components/Weekly';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <div>
          <Route path="/" element={<Weekly />}/>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
